import subprocess, re, base64, requests, psutil, tkinter as tk
from tkinter import PhotoImage


regex_token =  '--remoting-auth-token=([^"]*)'
regex_port = '--app-port=([^"]*)'
cmd = '(Get-WmiObject Win32_Process -Filter "name = `"LeagueClientUx.exe`"" | Select-Object CommandLine).CommandLine'
PROCNAME = "LeagueClientUxRender.exe"
base64_img = ""

def get_league_commandline():
    s = str(subprocess.run(["powershell", "-C", cmd], capture_output=True))
    return s

def get_token(s):
    m1 = re.search(regex_token, s)
    token = "riot:"+m1.group(1)
    token_bytes = token.encode("ascii")
    encoded_token = base64.b64encode(token_bytes)
    tok = encoded_token.decode("ascii")
    return tok

def get_port(s):
    m2 = re.search(regex_port, s)
    port = m2.group(1)
    return port


def restart_ux():
    post("/riotclient/kill-and-restart-ux")
    
def kill_ux():
    post("/riotclient/kill-ux")
    
def start_ux():
    post("/riotclient/launch-ux")

def post(suffix):
    cmd_line = get_league_commandline()
    tok = get_token(cmd_line)
    port = get_port(cmd_line)
    url = "https://127.0.0.1:" + port + suffix
    headers = {"Authorization":"Basic "+tok, "Content-Type": "application/json; charset=utf-8"}
    requests.post(url, data = "", headers=headers, verify=False)

def force_kill_ux():
    for proc in psutil.process_iter():
        if proc.name() == PROCNAME:
            proc.kill()

app = tk.Tk()
app.geometry("180x110")
button_restart_ux = tk.Button(app, text="Restart UI", command=restart_ux)
button_force_restart_ux = tk.Button(app, text="Force restart UI", command=force_kill_ux)
button_restart_ux = tk.Button(app, text="Restart UI", command=restart_ux)
button_kill_ux = tk.Button(app, text="Kill UI", command=kill_ux)
button_start_ux = tk.Button(app, text="Start UI", command=start_ux)
button_restart_ux.pack()
button_force_restart_ux.pack()
button_kill_ux.pack()
button_start_ux.pack()
p1 = PhotoImage(data = base64_img)

app.iconphoto(False, p1)
app.mainloop()
